import { Button } from './Button';
import {test} from '../Images/Hamburger.jpg';

export const ProductsSliderMenue = () => {
    return (
        <div className = "card text-center">
                   <div className = "overflow">
                   <img src       = {test} alt = 'Image 1' className='card-img-top' />
                       </div>
                       <div className = "card-body text-dark">
                       <h4  className = "card-title">Pizza</h4>
                       <p   className = "card-text text-secondary">
                               Lorem ipsum, dolor sit amet consectetur adipisicing elit. 
                               Illum tempore iusto voluptas quasi a. Autem consequuntur eos est labore, 
                               voluptatibus enim accusantium distinctio quod, dolor natus omnis velit obcaecati itaque!
                           </p>
                           <Button to = '/goToMenue' primary = 'true'>Menue</Button>
                       </div>
                   </div> 
    )
}

export default ProductsSliderMenue



